import React, { Component } from 'react';
import Main from "./main";
import Contact from "./contact";
import About from './about';
import Games from './games';
import {BrowserRouter as Router, Switch} from 'react-router';

class Navigation extends Component{
    render(){
        // const history = createBrowserHistory();
      return (
        <div className="App">
          <header className="App-header">
            
            <Router>
              <Switch>
                <Route path={process.env.PUBLIC_URL +"/about"} component={about}/>
                <Route exact path={process.env.PUBLIC_URL +"/projects"} component={portfolio}/>
                <Route path={process.env.PUBLIC_URL +"/projects/:id"} component={display}/>
                <Route path={process.env.PUBLIC_URL +"/contact"} component={contact}/>
                <Route path={process.env.PUBLIC_URL +"/art"} component={art}/> 
                <Route exact path={process.env.PUBLIC_URL +"/"} component={main}/>
              </Switch>
            </Router> 
            
          </header>
        </div>
      );
      }
}

export default Navigation;
